import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

function ImagesAnnotationPage() {
  const { id } = useParams();
  const [image, setImage] = useState(null);

  useEffect(() => {
    fetch(`http://localhost:5000/images/edit/${id}`)
      .then((res) => res.json())
      .then((data) => {
        setImage(data.data);
      })
      .catch((error) => {
        console.log("Error fetching image:", error);
      });
  }, [id]);

  return (
    <div>
      <h1>Image Editing Page</h1>
      {image && (
        <img
          alt="Clicked_Image"
          width={800}
          height={700}
          src={image.image}
        />
      )}
    </div>
  );
}

export default ImagesAnnotationPage;
